/*Table structure for table `dic_info` */

DROP TABLE IF EXISTS `dic_info`;

CREATE TABLE `dic_info` (
  `ID` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `NAME` varchar(50) NOT NULL COMMENT '名称',
  `ALIAS` varchar(50) DEFAULT NULL COMMENT '别名',
  `SYS_ID` int(11) NOT NULL COMMENT '系统ID',
  `TYPE_KEY` varchar(50) NOT NULL COMMENT '字典类型KEY',
  `CODE` varchar(50) DEFAULT NULL COMMENT '代码',
  `VALUE` varchar(500) DEFAULT NULL COMMENT '值',
  `SORT` tinyint(4) NOT NULL COMMENT '排序',
  `STATUS` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态 : 1=正常 2=失效',
  `REMARK` varchar(500) DEFAULT NULL COMMENT '备注',
  `CREATE_TIME` datetime NOT NULL COMMENT '创建时间',
  `UPDATE_TIME` datetime NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=127 DEFAULT CHARSET=utf8mb4 COMMENT='系统数据字典信息';

