/*Table structure for table `dic_sys_type` */

DROP TABLE IF EXISTS `dic_sys_type`;

CREATE TABLE `dic_sys_type` (
  `ID` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `NAME` varchar(50) DEFAULT NULL COMMENT '系统名称',
  `STATUS` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态：1=正常 2=失效',
  `REMARK` varchar(200) DEFAULT NULL COMMENT '备注',
  `CREATE_TIME` datetime NOT NULL COMMENT '创建时间',
  `UPDATE_TIME` datetime NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COMMENT='字典系统类型';

/*Data for the table `dic_sys_type` */

