/*Table structure for table `dic_tree` */

DROP TABLE IF EXISTS `dic_tree`;

CREATE TABLE `dic_tree` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `SYS_ID` bigint(20) DEFAULT NULL COMMENT '系统ID',
  `SYS_NAME` varchar(50) DEFAULT NULL COMMENT '系统名称',
  `TYPE_KEY` varchar(50) DEFAULT NULL COMMENT '字典类型KEY',
  `TYPE_NAME` varchar(100) DEFAULT NULL COMMENT '字典类型名称',
  `NAME` varchar(50) DEFAULT NULL COMMENT '名称',
  `ALIAS` varchar(50) DEFAULT NULL COMMENT '别名',
  `CODE` varchar(50) DEFAULT NULL COMMENT '代码',
  `LOGO` varchar(128) DEFAULT NULL COMMENT 'logo',
  `VALUE` varchar(50) DEFAULT NULL COMMENT '值',
  `LEAF_NODE` tinyint(4) DEFAULT '0' COMMENT '是否叶子节点1：是 0：否',
  `PAR_CODE` varchar(50) DEFAULT NULL COMMENT '上级代码',
  `PAR_NAME` varchar(50) DEFAULT NULL COMMENT '上级名称',
  `SORT` int(4) DEFAULT NULL COMMENT '排序',
  `STATUS` tinyint(4) DEFAULT '1' COMMENT '状态 0：无效 1：有效',
  `REMARK` varchar(200) DEFAULT NULL COMMENT '备注',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '更新时间',
  `EXTEND1` varchar(50) DEFAULT NULL COMMENT '预留字段1',
  `EXTEND2` varchar(50) DEFAULT NULL COMMENT '预留字段2',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=327 DEFAULT CHARSET=utf8mb4 COMMENT='DIC_TREE 字典树';

