/*Table structure for table `enterprise_img` */

DROP TABLE IF EXISTS `enterprise_img`;

CREATE TABLE `enterprise_img` (
  `ID` bigint(11) NOT NULL AUTO_INCREMENT,
  `ENTERPRISE_ID` bigint(11) NOT NULL COMMENT '企业ID',
  `IMG_URL` varchar(255) CHARACTER SET utf8mb4 NOT NULL COMMENT '图片路径',
  `REMARK` varchar(100) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '备注',
  `STATUS` tinyint(1) NOT NULL COMMENT '状态：0.无效 1.有效',
  `CRAETE_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `CREATOR_ID` bigint(11) DEFAULT NULL COMMENT '创建人ID',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='企业信息-图片';

/*Data for the table `enterprise_img` */

/*Table structure for table `enterprise_info` */

DROP TABLE IF EXISTS `enterprise_info`;

CREATE TABLE `enterprise_info` (
  `ID` bigint(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `NAME` varchar(100) CHARACTER SET utf8mb4 NOT NULL COMMENT '公司名称',
  `SHORT_NAME` varchar(100) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '公司简称',
  `ENGLISH_NAME` varchar(100) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '英文名称',
  `COMPANY_NATURE` varchar(50) CHARACTER SET utf8mb4 NOT NULL COMMENT '公司性质(数据来源DIC_INFO,字段TYPE_KEY=ENTERPRISE_NATURE_PROPETY)',
  `BUSSINESS_TYPE` varchar(50) CHARACTER SET utf8mb4 NOT NULL COMMENT '公司行业(数据来源于DIC_TREE)',
  `COMPANY_SIZE` varchar(50) CHARACTER SET utf8mb4 NOT NULL COMMENT '公司规模(数据来源于DIC_INFO,TYPE_KEY=ENTERPRISE_SIZE_PROPETY)',
  `PROVINCE_NO` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '公司所在地省级编码',
  `CITY_NO` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '公司所在地市级编码',
  `AREA_NO` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '公司所在地区级编码',
  `WEBSITE` varchar(150) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '公司官网',
  `EMAIL` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '公司邮箱',
  `TEL` varchar(20) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '公司座机号码',
  `CONTACTER` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '联系人',
  `PHONE` varchar(11) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT '联系人手机号码',
  `POSTAL_CODE` varchar(10) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '邮政编码',
  `ADDRESS` varchar(200) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '公司办公地址',
  `DESCRIPTION` varchar(500) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '公司简介',
  `LOGO` varchar(200) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '公司logo图片地址',
  `BUSSINESS_LICENCE_IMG` varchar(200) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '营业执照照片路径',
  `IS_OPENLY` tinyint(1) DEFAULT NULL COMMENT '是否公开身份(1.愿意公开我的公司名称  0.不公开显示为“某民营公司”)',
  `STATUS` tinyint(1) NOT NULL COMMENT '状态：0.冻结(无效) 1.审核中 2.审核通过',
  `DELETED` tinyint(1) NOT NULL COMMENT '是否删除：0.否 1.是',
  `CREATE_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `CREATOR_ID` bigint(11) NOT NULL COMMENT '创建人ID',
  `UPDATE_TIME` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `UPDATOR_ID` bigint(11) DEFAULT NULL COMMENT '更新人ID',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='企业信息';

/*Data for the table `enterprise_info` */

/*Table structure for table `enterprise_job_info` */

DROP TABLE IF EXISTS `enterprise_job_info`;

CREATE TABLE `enterprise_job_info` (
  `ID` bigint(11) NOT NULL AUTO_INCREMENT,
  `ENTERPRISE_ID` bigint(11) NOT NULL COMMENT '企业ID',
  `JOB_NAME` varchar(100) CHARACTER SET utf8mb4 NOT NULL COMMENT '职位名称',
  `PROVINCE_NO` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '发布地区省级编码',
  `CITY_NO` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '发布地区市级编码',
  `AREA_NO` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '发布地址区级编码',
  `WORK_ADDRESS` varchar(150) CHARACTER SET utf8mb4 NOT NULL COMMENT '工作地址',
  `RECRUIT_NUM` int(11) DEFAULT NULL COMMENT '招聘人数',
  `WORK_NATURE` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '工作性质，比如全职、兼职(数据来源于DIC_INFO)',
  `SLARY_TYPE` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '薪资类型比如年薪、月薪(数据来源于DIC_INFO)',
  `SLARY_VALUE` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '薪资(数据来源于DIC_INFO)',
  `KEYWORD` varchar(150) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '职位关键字(多个关键字以","隔开)',
  `DESCRIPTION` varchar(500) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '职位描述',
  `STATUS` tinyint(1) NOT NULL COMMENT '状态：0.无效 1.有效',
  `CREATE_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `CREATOR_ID` bigint(11) NOT NULL COMMENT '创建人ID',
  `UPDATE_TIME` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `UPDATE_ID` bigint(11) DEFAULT NULL COMMENT '更新人ID',
  `EXTEND_STR1` varchar(100) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '扩展字段1',
  `EXTEND_STR2` varchar(100) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '扩展字段1',
